import { Injectable } from '@angular/core';
import { Subject } from 'rxjs';


@Injectable({
  providedIn: 'root'
})
export class ObserversService {

  private themeObs = new Subject<any>();
  private events = new Subject<any>();
  private dateSelectedCalendar = new Subject<any>();
  private deleteEventCalendar = new Subject<any>();
  private addEventCalendar = new Subject<any>();
  private eventCurrentDay = new Subject<any>();
  private closeViews = new Subject<any>();

  constructor() { }


  changeTheme(theme) {
    this.themeObs.next(theme);
  }

  viewTheme() {
    return this.themeObs.asObservable();
  }

  /// Calendar
  changeEvents(e) {
    this.events.next(e);
  }

  viewEventsChanges() {
    return this.events.asObservable();
  }

  selectedDateCalendar(date) {
    this.dateSelectedCalendar.next(date);
  }

  viewSelectedDateCalendar() {
    return this.dateSelectedCalendar.asObservable();
  }

  deleteEventDay(event) {
    this.deleteEventCalendar.next(event);
  }

  viewDeleteEvenDay() {
    return this.deleteEventCalendar.asObservable();
  }

  addEditEventDay(eventsDay, currentDay, Type) {
    const temp = { events: eventsDay, day: currentDay, type: Type };
    this.addEventCalendar.next(temp);
  }

  viewAddEventDay() {
    return this.addEventCalendar.asObservable();
  }

  setEventCurrentDay(event) {
    this.eventCurrentDay.next(event);
  }

  viewEventCurrentDay() {
    return this.eventCurrentDay.asObservable();
  }


  setCloseviews() {
    this.closeViews.next();
  }

  viewCloseViews() {
    return this.closeViews.asObservable();
  }


  ////// NOTIFICATION
  makenotification(eventTitle, Body) {
    const notification = new Notification(eventTitle, { body: Body, vibrate: [100, 50, 100], timestamp: Math.floor(Date.now()),
       requireInteraction: true, icon: 'data:image/png;base64,', dir: 'auto' });
    // setTimeout(() => {
    //   notification.close();
    // }, 10000);
    notification.onclick = (e) => {
      e.preventDefault();
      alert('Aceptada');
      window.open('http://www.mozilla.org', '_blank');
    };
  }

  getPermission() {
    document.addEventListener('DOMContentLoaded', () => {
      // document.getElementById('notifyButton').addEventListener('click', () => {

      //   if (!('Notification' in window)) {
      //     console.log('Web Notification not supported');
      //     return;
      //   }

      Notification.requestPermission((permission) => {
        const notification = new Notification('TpCalendar', { body: 'welcome to your calendar', icon: 'data:image/png;base64,', dir: 'auto' });
        setTimeout(() => {
          notification.close();
        }, 10000);
      });
    });
    // });
  }
}
